{{drecera|[[VP:QQ13]]}} [[Fitxer:Keeptidy ask.png|thumb|És hora de fer manteniment.]] == Gran Quinzena Anual de la Qualitat 2013 == L'objectiu de la '''Gran Quinzena''' del 2013 és ocupar-se d'aquells articles marcats per una [[:Categoria:Plantilles de manteniment|plantilla de manteniment]], dins categories que no paren de créixer. S'aniran apuntant les millores en una taula per fer un millor seguiment de la feina conjunta. S'inicia oficialment el dia '''21 de desembre de 2013''' i acaba el '''5 de gener de 2014'''.
